import React from 'react'

const TripCard = ({ trip }) => {
  return (
    <div>
      <h3>{trip.attributes.name}</h3>
      <p>{trip.attributes.start_date}</p>
      <p>{trip.attributes.end_date}</p>
    </div>
  )
}

export default TripCard
